import React from 'react';
import TableWidget from '../widgets/TableWidget'

function createData(name, age, phone, email, company, registeredevents=1) {
    return { name, age, phone, email, company, registeredevents };
  }
  
  const rows = [
    createData('Cupcake', 25, 3.7, 67, 4.3,1),
    createData('Donut', 30, 25.0, 51, 4.9, 2),
    createData('Eclair', 35, 16.0, 24, 6.0,1),
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0,3),
    createData('Gingerbread', 35, 16.0, 49, 3.9,4),
    createData('Honeycomb', 40, 3.2, 87, 6.5,5),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3,6),
    createData('Jelly Bean', 41, 0.0, 94, 0.0,5),
    createData('KitKat', 42, 26.0, 65, 7.0,5),
    createData('Lollipop', 27, 0.2, 98, 0.0,5),
    createData('Marshmallow', 318, 0, 81, 2.0,5),
    createData('Nougat', 28, 19.0, 9, 37.0,5),
    createData('Oreo', 29, 18.0, 63, 4.0,5),
  ];

const columns = [
    { key_id: 'name', numeric: false, disablePadding: true, label: 'Name' },
    { key_id: 'age',  numeric: true, disablePadding: false, label: 'Age' },
    { key_id: 'phone', numeric: true, disablePadding: false, label: 'Phone' },
    { key_id: 'email', numeric: false, disablePadding: false, label: 'Email' },
    { key_id: 'company', numeric: false, disablePadding: false, label: 'Company' },
    { key_id: 'registeredevents', numeric: true, disablePadding: false, label: 'Registered Events'}
  ];

function Usertable(){
    const tableTitle="User List";
    return (
        <React.Fragment>
            <h1>User Table</h1>
            <TableWidget 
              rows={rows} 
              columns={columns}
              tableTitle={tableTitle}
            
            />
        </React.Fragment>
    );
}

export default Usertable;
